function quickSort(arr){
    if(arr.length <= 1){
        return arr
    }

    let left = [], right = []
    const pivot = arr[0]
 
    for(let i = 1; i < arr.length; i++){
        if(arr[i] <= pivot){
            left.push(arr[i])
        }
        else{
            right.push(arr[i])
        }
    }
    return [...quickSort(left), pivot, ...quickSort(right)]
}

